import React from "react"
import "./styles.css";

// COMPONENTE
// ícone chat
import { BsFillChatSquareFill } from "react-icons/bs";



function ChatBox() {
    return (
        <>
            <div className="chatbox">
                <div>
                <a href="#">
                    <BsFillChatSquareFill />
                </a>
                </div>
            </div>
        </>
    )
}

export default ChatBox
